import go from 'gojs';
class createDuBang {
  constructor(initData) {
    this.initData = initData;
    this.myDiagram = {};
  }
  /**
   * @name: 初始化
   * @test: test font
   * @msg:
   * @param {*}
   * @return {*}
   */
  init() {
    var $ = go.GraphObject.make;
    let myDiagram = $(
      go.Diagram,
      this.initData.rightName, // 必须命名或引用DIV HTML元素
      {
        initialContentAlignment: go.Spot.Center,
        allowDrop: false,
        scrollsPageOnFocus: false,
        'undoManager.isEnabled': false,
        'toolManager.mouseWheelBehavior': go.ToolManager.WheelZoom,
        LinkDrawn: showLinkLabel, // 该DiagramEvent侦听器在下面定义
        LinkRelinked: showLinkLabel,
        isReadOnly:true,
        'undoManager.isEnabled': false // 启用撤消和重做
      }
    );
    // 复制功能, 复制除了key之外的值
    myDiagram.model.copiesKey = false;
    this.myDiagram = myDiagram;
    // 节点模板的帮助程序定义
    function nodeStyle() {
        return [
            // Node.location来自节点数据的“ loc”属性,
            // 由Point.parse静态方法转换.
            // 如果Node.location更改，它将更新节点数据的“ loc”属性,
            // 使用Point.stringify静态方法转换回.
            new go.Binding('location', 'loc', go.Point.parse).makeTwoWay(
                go.Point.stringify
            ),
            {
                // Node.location位于每个节点的中心
                locationSpot: go.Spot.Center
            }
        ];
    }

    // 定义用于创建通常透明的“端口”的函数.
    // "name" 用于 GraphObject.portId,
    // "align" 用于确定端口相对于节点主体的位置,
    // "spot" 用于控制链接与端口的连接方式以及端口是否
    // 沿着节点的侧面延伸,
    // and the boolean "output" and "input" 参数控制用户是否可以从端口绘制链接或到端口.
    function makePort(name, align, spot, output, input) {
      var horizontal =
        align.equals(go.Spot.Top) || align.equals(go.Spot.Bottom);
      // 端口基本上只是一个透明的矩形，沿着节点的侧面延伸,
      // 并在鼠标经过时变成彩色
      return $(go.Shape, {
        fill: 'transparent', // 在mouseEnter事件处理程序中更改为颜色
        strokeWidth: 0, // no stroke
        width: horizontal ? NaN : 8, // 如果不水平伸展，则只有8宽
        height: !horizontal ? NaN : 8, // 如果不垂直伸展，则只有8高
        alignment: align, // 在主形状上对齐端口
        stretch: horizontal
          ? go.GraphObject.Horizontal
          : go.GraphObject.Vertical,
        portId: name, // 声明此对象为 a "port"
        fromSpot: spot, // 声明链接可以在此端口连接的位置
        fromLinkable: output, // 声明用户是否可以从此处绘制链接
        toSpot: spot, // 声明链接可以在此端口连接的位置
        toLinkable: input, // 声明用户是否可以在此处绘制链接
        cursor: 'pointer', // 显示不同的光标以指示潜在的链接点
        mouseEnter: function(e, port) {
          // PORT参数将是这个Shape
          if (!e.diagram.isReadOnly) port.fill = 'rgba(255,0,255,0.5)';
        },
        mouseLeave: function(e, port) {
          port.fill = 'transparent';
        }
      });
    }
    // 字体样式
    function textStyle() {
        return {
            margin:10,
            font: '14px Helvetica, Arial, sans-serif',
            stroke: '#606266'
        };
    }

    var nodeResizeAdornmentTemplate =
        $(go.Adornment, "Spot",
            { locationSpot: go.Spot.Right },
            $(go.Placeholder),
            $(go.Shape, { alignment: go.Spot.TopLeft, cursor: "nw-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),
            $(go.Shape, { alignment: go.Spot.Top, cursor: "n-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),
            $(go.Shape, { alignment: go.Spot.TopRight, cursor: "ne-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),

            $(go.Shape, { alignment: go.Spot.Left, cursor: "w-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),
            $(go.Shape, { alignment: go.Spot.Right, cursor: "e-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),

            $(go.Shape, { alignment: go.Spot.BottomLeft, cursor: "se-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),
            $(go.Shape, { alignment: go.Spot.Bottom, cursor: "s-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" }),
            $(go.Shape, { alignment: go.Spot.BottomRight, cursor: "sw-resize", desiredSize: new go.Size(6, 6), fill: "lightblue", stroke: "deepskyblue" })
        );

    // 任务节点
    function addStepType({ type, color = 'beige' }) {
      myDiagram.nodeTemplateMap.add(
        type, // the default category
        $(go.Node,'Auto',nodeStyle(),{
            resizable: true,resizeObjectName: "PANEL", resizeAdornmentTemplate: nodeResizeAdornmentTemplate
          },
          $(go.Panel,'Auto',
            { name: "PANEL" },
            new go.Binding("desiredSize", "size", go.Size.parse).makeTwoWay(go.Size.stringify),
            $(go.Shape,'RoundedRectangle',
              { fill: color},
              new go.Binding('strokeWidth','borderWidth'),
              new go.Binding('stroke','borderColor'),
              new go.Binding('fill') ),
            $(go.TextBlock,
                textStyle(),
              {
                // maxSize: new go.Size(180, NaN),
                wrap: go.TextBlock.WrapFit,
              },
              new go.Binding('text').makeTwoWay(),
              new go.Binding('stroke','color'),
              new go.Binding('font','font')
            )
          ),
            makePort('T', go.Spot.Top, go.Spot.TopSide, false, true),
            makePort('L', go.Spot.Left, go.Spot.LeftSide, true, true),
            makePort('R', go.Spot.Right, go.Spot.RightSide, true, false),
            makePort('B', go.Spot.Bottom, go.Spot.BottomSide, true, true) 
        )
      );
    }

    addStepType({ type: 'Step' });

    // 文本节点
    function addParallelType({ type }) {
      myDiagram.nodeTemplateMap.add(
        type,
        $(
          go.Node,
          'Table',
          nodeStyle(),
          $(
            go.Panel,
            'Auto',
            $(go.TextBlock, textStyle(),
              {
                maxSize: new go.Size(180, NaN),
                wrap: go.TextBlock.WrapFit, // 尺寸自适应
                editable: true,  // 文字可编辑
                font: "bold 14px Helvetica, Arial, sans-serif",
                stroke: "#606266"
              },
              new go.Binding("text").makeTwoWay())
          )
        )
      );
    }

    addParallelType({ type: 'Parallel' });

    // 上下节点
    function addSubType({ type, color = 'beige' }) {
        myDiagram.nodeTemplateMap.add(
        type, 
        $( go.Node,'Auto',nodeStyle(),{
                resizable: true,resizeObjectName: "PANEL", resizeAdornmentTemplate: nodeResizeAdornmentTemplate
            },
            { name: "PANEL" },
            new go.Binding("desiredSize", "size", go.Size.parse).makeTwoWay(go.Size.stringify),
            $(go.Shape,'RoundedRectangle',
                { fill: color },
                new go.Binding('strokeWidth', 'borderWidth'),
                new go.Binding('figure', 'figure'),
                new go.Binding('stroke','borderColor'),
                new go.Binding('fill')
              ),
            $(go.Panel,'Table',
                $(go.RowColumnDefinition, 
                    { row: 1},
                    new go.Binding('separatorStroke','borderColor')
                ),
                $(go.RowColumnDefinition, { row: 2}),
                $(go.TextBlock,textStyle(),
                    new go.Binding('text','topTxt').makeTwoWay(),
                    new go.Binding('stroke','color'),
                    new go.Binding('font','font'),
                    {  
                        row: 0, 
                        column: 0,
                        textAlign: "center",
                        maxSize: new go.Size(180, NaN),
                        font: "14px Helvetica, Arial, sans-serif",
                        wrap: go.TextBlock.WrapFit
                    }
                ),
                $(go.TextBlock,textStyle(),
                    new go.Binding('text','bottomTxt').makeTwoWay(),
                    new go.Binding('stroke','color'),
                    new go.Binding('font','font'),
                    {   row: 1, 
                        column: 0, 
                        textAlign: "center" ,
                        font: "14px Helvetica, Arial, sans-serif",
                        maxSize: new go.Size(180, NaN),
                        wrap: go.TextBlock.WrapFit
                    }
                ),
        ),

        makePort('T', go.Spot.Top, go.Spot.TopSide, false, true),
        makePort('L', go.Spot.Left, go.Spot.LeftSide, true, true),
        makePort('R', go.Spot.Right, go.Spot.RightSide, true, false),
        makePort('B', go.Spot.Bottom, go.Spot.BottomSide, true, true)
    ));}

    addSubType({ type: 'Sub' });

    // 左右节点
    function addLrType({ type, color = 'beige' }) {
        myDiagram.nodeTemplateMap.add(
            type, // the default category
            $(go.Node,'Auto',nodeStyle(),{
                resizable: true,resizeObjectName: "PANEL", resizeAdornmentTemplate: nodeResizeAdornmentTemplate
            },
            { name: "PANEL" },
            new go.Binding("desiredSize", "size", go.Size.parse).makeTwoWay(go.Size.stringify),
                $(go.Shape,'RoundedRectangle',
                    { fill: color },
                    new go.Binding('strokeWidth', 'borderWidth'),
                    new go.Binding('figure', 'figure'),
                    new go.Binding('stroke','borderColor'),
                    new go.Binding('fill'),
                ),
                $(go.Panel,'Table',
                    $(go.RowColumnDefinition, { column: 1 },
                        new go.Binding('separatorStroke','borderColor')
                    ),
                    $(go.RowColumnDefinition, { column: 2 }),
                    $(go.TextBlock,textStyle(),
                        {   row: 0, 
                            column: 0, 
                            textAlign: "center",
                            font: "14px Helvetica, Arial, sans-serif",
                            wrap: go.TextBlock.WrapFit
                        },
                        new go.Binding('text','leftTxt').makeTwoWay(),
                        new go.Binding('stroke','color'),
                        new go.Binding('font','font'),
                    ),
                    $(go.TextBlock,textStyle(),
                        {
                            row: 0, 
                            column: 1, 
                            margin: 5, 
                            textAlign: "center",
                            font: "14px Helvetica, Arial, sans-serif",
                            wrap: go.TextBlock.WrapFit
                        },
                        new go.Binding('text','rightTxt').makeTwoWay(),
                        new go.Binding('stroke','color'),
                        new go.Binding('font','font'),
                    )
                ),
            makePort('T', go.Spot.Top, go.Spot.TopSide, true, true),
            makePort('L', go.Spot.Left, go.Spot.LeftSide, true, true),
            makePort('R', go.Spot.Right, go.Spot.RightSide, true, true),
            makePort('B', go.Spot.Bottom, go.Spot.BottomSide, true, true)
        ));}

    addLrType({ type: 'Lr' });

    // 初始化连接线的模板
    myDiagram.linkTemplate = $(go.Link, // the whole link panel
        {
            routing: go.Link.AvoidsNodes,
            curve: go.Link.JumpOver,
            corner: 5,
            toShortLength: 4,
            relinkableFrom: true,
            relinkableTo: true,
            reshapable: true,
            resegmentable: true,
            mouseEnter: function(e, link) {
            link.findObject('HIGHLIGHT').stroke = 'rgba(30,144,255,0.2)';
            },
            mouseLeave: function(e, link) {
            link.findObject('HIGHLIGHT').stroke = 'transparent';
            },
            selectionAdorned: false
        },
      new go.Binding('points').makeTwoWay(),
      $(
        go.Shape, // the highlight shape, normally transparent
        {
          isPanelMain: true,
          strokeWidth: 0,
          stroke: 'transparent',
          name: 'HIGHLIGHT'
        }
      ),
      $(
        go.Shape, // the link path shape
        { isPanelMain: true, stroke: "#606266", strokeWidth: 2 },
        new go.Binding('stroke','color')
      ),
      $(
        go.Shape, // 箭头配置
        { toArrow: 'standard', strokeWidth: 0, fill: "#606266" },
        new go.Binding('fill','color')
      ),
      $(go.Panel,'Auto', // the link label, normally not visible
        { visible: false,name: "LABEL", segmentIndex: 2, segmentFraction: 0.5},
        new go.Binding('visible', 'visible').makeTwoWay(),
        $(go.Shape,'RoundedRectangle', // the label shape
          { fill: 'transparent', strokeWidth: 0 }
        ),
        $(go.TextBlock,"连线",
          { textAlign: 'center',
            font: '14px helvetica, arial, sans-serif',
            stroke: "#606266",
            minSize: new go.Size(10, NaN),
            editable: true
          },
          new go.Binding('text').makeTwoWay()
        )
      )
    );
    // 如果来自“Conditional”节点，则使链接标签可见。
    // 该侦听器由“ LinkDrawn”和“ LinkRelinked” DiagramEvents调用。
    function showLinkLabel(e) {
      var label = e.subject.findObject('LABEL');
      if (label) {
        label.visible = true;
      }
    }

    // 临时的连线（还在画图中），包括重连的连线，都保持直角
    myDiagram.toolManager.linkingTool.temporaryLink.routing =
    go.Link.Orthogonal;
    myDiagram.toolManager.relinkingTool.temporaryLink.routing =
    go.Link.Orthogonal;

    this.load(); // 从一些JSON文本加载初始图
  }
  // Show the diagram's model in JSON format that the user may edit
    save() {
        // console.log(this.myDiagram.model.toJson());
        this.myDiagram.isModified = false;
    }
    // 节点动态更新 (不需要load)
    change(e) {
        var nodeData = this.myDiagram.model.findNodeDataForKey(e.key);
        if(e.category === 'Step') {
            nodeData.text = e.text
        }else if(e.category === 'Sub') {
            nodeData.topTxt = e.topTxt
            nodeData.bottomTxt = e.bottomTxt
        }else if(e.category === 'Lr') {
            nodeData.leftTxt = e.leftTxt
            nodeData.rightTxt = e.rightTxt
        }
        nodeData.color = e.color // 字体颜色
        nodeData.fill = e.fill // 背景颜色
        nodeData.font = e.font // 字体大小
        nodeData.borderColor = e.borderColor // 边框颜色
        nodeData.borderWidth = e.borderWidth // 边框大小
        this.myDiagram.model.updateTargetBindings(nodeData);
    }

    // 全局配置更新
    globalChange(e) {
        var nodeDataArray = JSON.parse(this.getJson()).nodeDataArray
        nodeDataArray.map(x=> {
            var nodeData = this.myDiagram.model.findNodeDataForKey(x.key);
            nodeData.color = e.color // 字体颜色
            nodeData.fill = e.fill // 背景颜色
            nodeData.font = e.font // 字体大小
            nodeData.borderColor = e.borderColor // 边框颜色
            nodeData.borderWidth = e.borderWidth // 边框大小
            this.myDiagram.model.updateTargetBindings(nodeData);
        })
    }

    getJson() {
        return this.myDiagram.model.toJson();
    }

    load(datas) {
        if (datas) {
            this.myDiagram.model = go.Model.fromJson(JSON.stringify(datas));
        }
    }

    // 通过打开一个包含每个页面的图表内容的SVG图像的新窗口来打印图表
    printDiagram() {
        var svgWindow = window.open();
        if (!svgWindow) return; // 未能打开新窗口
        var printSize = new go.Size(700, 960);
        var bnds = this.myDiagram.documentBounds;
        var x = bnds.x;
        var y = bnds.y;
        while (y < bnds.bottom) {
            while (x < bnds.right) {
            var svg = this.myDiagram.makeSVG({
                scale: 1.0,
                position: new go.Point(x, y),
                size: printSize
            });
            svgWindow.document.body.appendChild(svg);
            x += printSize.width;
            }
            x = bnds.x;
            y += printSize.height;
        }
        setTimeout(function() {
            svgWindow.print();
        }, 1);
    }
}

export default createDuBang;
